import React from 'react';

function Body(props) {
  return (
  <div>


      {
    props.data.map((val) => <img key={val.id} src={`https://farm${val.farm}.staticflickr.com/${val.server}/${val.id}_${val.secret}.jpg`}/>)
  }
  </div>
  );
}

export default Body;
